import React from "react";
import ReactDOM from "react-dom";
import { Header } from "./components/Header";
const element={
    user: {
        name: "Edison",
        img: "esta es la ruta"
    }
}
ReactDOM.render(<Header user={element.user}/>, document.getElementById("root"));
